import React, { Component } from "react";
import Col from "react-bootstrap/Col";
import Nav from "react-bootstrap/Nav";
import Row from "react-bootstrap/Row";
import Tab from "react-bootstrap/Tab";

export default class RankingSidebar extends Component {
  render() {
    return (
      <div class="ranking-sidebar ">
        <Tab.Container id="left-tabs-example" defaultActiveKey="first">
          <Nav variant="tabs" className="flex-column">
            <Row className="g-0">
              <Col sm={true}>
                <RankingItem iconName="visibility" tittle="Top Xem"></RankingItem>

              </Col>
              <Col sm={true}>
                <Nav.Item style={{ overflow: "hidden" }}>
                  <Nav.Link
                    eventKey="second"
                    className="d-flex align-items-center"
                  >
                    <span class="material-symbols-outlined">favorite</span>
                    <span class="ms-2">Top Theo DÃµi</span>
                  </Nav.Link>
                </Nav.Item>
              </Col>
            </Row>
          </Nav>
          <Tab.Content className="border">
            <Tab.Pane eventKey="first">dasd</Tab.Pane>
            <Tab.Pane eventKey="second">fasf</Tab.Pane>
          </Tab.Content>
        </Tab.Container>
      </div>
    );
  }
}

function RankingItem(props) {
  return (
    <Nav.Item style={{ overflow: "hidden" }}>
      <Nav.Link
        eventKey="first"
        className="d-flex align-items-center"
        style={{ color: "red" }}
      >
        <span class="material-symbols-outlined">{props.iconName}</span>
        <span class="ms-2">{props.title}</span>
      </Nav.Link>
    </Nav.Item>
  );
}
